#Powershell GUI for Ping

#Import Icon in Base64:
$icon64 = ""
$icon = [System.IO.MemoryStream][System.Convert]::FromBase64String($icon64)

#Import Windows forms
Add-Type -Assembly System.Windows.Forms

#Create Objects
$main_form = New-Object System.Windows.Forms.Form
$pingproperties = @{ IPV4Address="ERROR"; Responsetime = "ERROR"; Address = ""}
$loglocation = "C:\users\Administrator\Desktop\test.bin"

#Create Functions

##Ping function input is from argc[0]
function ping-host {
    #Backup original button message
    $orig = $button.Text
    $button.Text = "Pinging"
    for($i=0; $i -lt 3; $i++) 
        {
            #Attempt to ping arg[0] return "ERROR" in all fields if fail, $? is used as try..catch wont work on test-connection
            $result = Test-Connection $args[0] -Count 1 -ErrorAction SilentlyContinue
            if ($?){
                write-table ($result)
            } else {
                $result = New-Object PSObject -Property $pingproperties
                $result.Address = $args[0]
                write-table $result
            }
        }
    #Restore button text
    $button.Text = $orig
}

##Write table function fo display in $datagridview
function write-table {
    $dataGridview.Rows.Add($args[0].IPV4Address,$args[0].Address,$args[0].ResponseTime)
    $lineno = $dataGridview.RowCount - 2
    color-cells $dataGridview $lineno
    log-binary $args[0].Address $args[0].ResponseTime
}
#Conditional Colouring
function color-cells {
    $testvalue = $args[0].Rows[$args[1]].Cells[2].Value
    if ($testvalue -lt 100) {
        for($i = 0; $i -lt 3; $i++){
          $args[0].Rows[$args[1]].Cells[$i].Style.BackColor = 'Purple'
        }
    }elseif($testvalue -lt 200) {
        for($i = 0; $i -lt 3; $i++){
          $args[0].Rows[$args[1]].Cells[$i].Style.BackColor = 'Pink'
        }
    }else {
        for($i = 0; $i -lt 3; $i++){
              $args[0].Rows[$args[1]].Cells[$i].Style.BackColor = 'Orange'
            }
    }
}

function log-binary {
    #Take inputs and put into local variables
    #Args[0] is a string of the address, we will need to store its length
    [byte]$address_length = $args[0].Length
    #Unpack string to bytes, unsure if necessary
    [byte[]]$address = @()
    for($i = 0; $i -lt $address_length; $i++){
        $address += $args[0][$i]
    }
    #Convert input time to bytes
    [byte[]]$time = [bitconverter]::GetBytes($args[1])
    [byte[]] $bytes = @()
    #Get Unix time
    #64 bits to futureproof unix time
    $time_unix_int64 = [convert]::toInt64([math]::Round((New-TimeSpan -Start (Get-Date "01/01/1970") -End (Get-Date)).TotalSeconds))
    $time_unix_bytes = [bitconverter]::getbytes($time_unix_int32)
    $bytes += $time_unix_bytes
    $bytes += $address_length
    $bytes += $address
    $bytes += $time
    #Append to original file
    $logfile = open-log
    $logfile += $bytes
    [io.file]::WriteAllBytes($loglocation,$logfile)
    Write-Host $logfile
}

function open-log {
    try{
        $logfile = [IO.file]::ReadAllBytes($loglocation)
    } Catch {
        Write-host "File doesn't exist: creating"
        [byte[]] $header = @()
        $header += 0xCA
        $header += 0xFE
        [io.file]::WriteAllBytes($loglocation, $header)
        $logfile = $header
    }
    return $logfile
}

function start-main {
#Create font objects
$Font_Arial_Small = New-Object System.Drawing.Font("Arial",8)
$Font_Arial_Medium = New-Object System.Drawing.Font("Arial",14)
$Font_Arial_Large = New-Object System.Drawing.Font("Arial",18)

#Add attributes to form:
$main_form.Text = 'GuiPing v1'
$main_form.Width = 900
$main_form.Height = 400
#Use the unencoded base64 as icon
$main_form.Icon = $icon
#Allow the form to stretch if items are out of bounds
$main_form.AutoSize = $true

#title label for application
$Label = New-Object System.Windows.Forms.Label
$Label.Text = "Test Address:"
$Label.AutoSize = $true
$Label.Font = $Font_Arial_large
$Label.Location = New-Object System.Drawing.Point(0,10)

#Input textbox for target specification
$textbox = New-Object System.Windows.Forms.TextBox
$textbox.Text = "127.0.0.1"
$textbox.Size = New-Object System.Drawing.Size(400,300)
$textbox.Font = $Font_Arial_Medium
$textbox.Location = New-Object System.Drawing.Point(250,12)

#Create a gridview for Ping results
$dataGridview = New-Object System.Windows.Forms.DataGridView
$dataGridview.Size = New-Object System.Drawing.Size(900,400)
$dataGridview.Location = New-Object System.Drawing.point(0,60)
$dataGridview.Font = New-Object System.Drawing.Font("Old English Text MT", 10)
$dataGridview.ColumnCount = 3
$dataGridview.ColumnHeadersVisible = $true
$dataGridView.AutoSizeColumnsMode = "Fill"
$dataGridview.Columns[0].Name = "Source"
$dataGridview.Columns[1].Name = "Destination"
$dataGridview.Columns[2].Name = "Time(ms)"

#create button to run ping
$button = New-Object System.Windows.Forms.Button
$button.Location = New-Object System.Drawing.Point(($main_form.Width - 240),10)
$button.size = New-Object System.Drawing.Size(240,32)
$button.text = "Ping"
$button.add_click({ping-host $textbox.Text})


#Packing gui
$main_form.Controls.Add($Label)
$main_form.Controls.Add($dataGridview)
$main_form.Controls.Add($button)
$main_form.Controls.Add($textbox)
#Display GUI, void ensures that it doesn't return a value on close.
[void] $main_form.ShowDialog()
}

#Start Program
start-main